    /**
     * Gets the attribute value for the calculated attribute TransErrorPercentage.
     * @return the TransErrorPercentage
     */
    public BigDecimal getTransErrorPercentage() {
        BigDecimal absErrorPer = null;
        try {

            if (getItem() != null && getCandyNetFinalAmount() != null &&
                getTransNetFinalAmount() != null) {

                Double candyNetAmt = getCandyNetFinalAmountNum().doubleValue();
                Double fussNetAmtDbl = getTransNetFinalAmount().doubleValue();

                if (candyNetAmt != null && fussNetAmtDbl != null) {
                    Double errPerDbl =
                        getDiffPercentageFrom(candyNetAmt, fussNetAmtDbl);
                    absErrorPer = new BigDecimal(errPerDbl);
                }
            }
        } catch (Exception e) {
            return null;
        }
        return absErrorPer;
        //        return (BigDecimal)getAttributeInternal(TRANSERRORPERCENTAGE);
    }

