    /**
     * Gets the attribute value for the calculated attribute TransAbsoluteErrorTotal.
     * @return the TransAbsoluteErrorTotal
     */
    public BigDecimal getTransAbsoluteErrorTotal() {
        BigDecimal absError = null;
        try {
            if (getTransCandyNetFinalAmntTotal() != null &&
                getTransNetFinalAmountTotal() != null) {

                Double candyTotCostBud =
                    getTransCandyNetFinalAmntTotal().doubleValue();
                Double fussTotCostbud =
                    getTransNetFinalAmountTotal().doubleValue();
                if (candyTotCostBud != null && fussTotCostbud != null) {
                    absError =
                            new BigDecimal(candyTotCostBud.doubleValue() - fussTotCostbud.doubleValue());
                }
            }

        } catch (Exception e) {
            return null;
        }
        return absError;

        //        return (BigDecimal)getAttributeInternal(TRANSABSOLUTEERRORTOTAL);
    }

